script: |
  super -f text -I q1210.spq | sort > q1210.out

inputs:
  - name: q1210.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE ( col2 ) NOT BETWEEN col0 / - col0 AND - 76 + - - col2 + - col1 + - + col1 + + col1 * col0;
  - name: tab2

outputs:
  - name: q1210.out
    data: |
